import tw from 'twin.macro';
import styled from 'styled-components';

const GreenStyled = styled.div`
    & {
        ${tw`bg-teal-100 border-t-4 border-teal-500 rounded-b text-teal-900`}
    }
`;

export default GreenStyled;
